SELECT (COUNT(?transition) AS ?totalMonths) 
WHERE {
  ?payer a syn:Payer ;
         syn:uniqueCustomers ?uniqueCustomers .
  ?transition a syn:PayerTransition ;
              syn:payer ?payer ;
              syn:startYear ?startYear .
  BIND(MONTH(NOW()) - MONTH(?startYear) + 12 * (YEAR(NOW()) - YEAR(?startYear)) AS ?months)
}

